import React, { Component } from 'react';

class SidebarNavigation extends Component {
    render() {
        return (
            <div className = 'sidebar-nav-links-scrollable'>
                <div>
                    Dashboard
                </div>
                <div>
                    Charts
                </div>
                <div>
                    Categories
                </div>
                <div>
                    Settings
                </div>
            </div>
        );
    }
}

export default SidebarNavigation;
